import React,{useState} from 'react';
import './App.css';
import AgeList from './components/AgeList';
import ShowUser from './components/ShowUser';


function App() {
  const [list,SetList]=useState({})
  const list_data=(data)=>{
    SetList((prevlist)=>{
      return [data,...prevlist];
    })

  }
  return (<div>
  <AgeList  list_data={list_data}></AgeList>
  <ShowUser users={list}></ShowUser>


    </div>
   );
}

export default App;
